import { useState } from "react";
import { Link } from "react-router-dom";

const Contato = () => {
    cont [nome, setNome] = useState();
    cont [email, setEmail] = useState();
    cont [telefone, setTelefone] = useState();
    cont [assunto, setAssunto] = useState();
    cont [mensagem, setMensagem] = useState();

    const eventoNome = (e) => {
        setNome(e.target.value);
    }

    const eventoEmail = (e) => {
        setEmail(e.target.value);
    }

    const eventoTelefone = (e) => {
        setTelefone(e.target.value);
    }

    const eventoAssunto = (e) => {
        setAssunto(e.target.value);
    }

    const eventoMensagem = (e) => {
        setMensagem(e.target.value);
    }
    
    return (
        <div className="container div-sobre">
            <div className="row">
                <div className="col-md-8 col-md-offset-2 text-center fh5co-heading">
                    <h3>Contato</h3>
                </div>
            </div>
            <div className="row">
                <form className="form-horizontal form-variavel form-head">
                    <div className="form-group">
                        <div className="col-md-12">
                            <input 
                                type="text" 
                                className="input form-control" 
                                placeholder="Digite seu Nome" />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input 
                                type="text" 
                                className="input form-control" 
                                placeholder="Digite seu E-mail" />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input 
                                type="text" 
                                className="input form-control" 
                                placeholder="Digite seu Telefone" />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">
                            <input 
                                type="text" 
                                className="input form-control" 
                                placeholder="Assunto" />
                        </div>
                    </div>
                    <div className="form-group">
                        <div className="col-md-12">

                        </div>
                    </div>

                    <div className="div-voltar">
                        <Link to="/"><button type="button" className="btn waves-effect waves-light btn-voltar">Voltar</button></Link>
                        <Link to="/"><button type="button" className="btn waves-effect btn-success waves-light btn-voltar">Salvar</button></Link>
                    </div>
                </form>
            </div>
        </div>
    );
};

export default Contato;
